import React, { useState, useMemo } from 'react';
import { useAppData } from '../../context/AppDataContext';
import Card from '../molecules/Card';
import CustomButton from '../atoms/CustomButton';
import Icon from '../atoms/Icon';
import FormGroup from '../molecules/FormGroup';
import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import {
  Chart as ChartJS,
  CategoryScale,
  LinearScale,
  BarElement,
  ArcElement,
  Title,
  Tooltip,
  Legend,
} from 'chart.js';
import { Bar, Pie } from 'react-chartjs-2';

ChartJS.register(CategoryScale, LinearScale, BarElement, ArcElement, Title, Tooltip, Legend);

const ReportesDirector = () => {
  const { solicitudes, profesores } = useAppData();
  const [loading, setLoading] = useState(false);

  const [filtros, setFiltros] = useState({
    profesorId: 'todos',
    fechaInicio: '',
    fechaFin: '',
    periodo: '',
  });

  const traducirEstado = (status) => {
    const traducciones = {
      completed: 'Completado',
      accepted: 'Aceptado',
      rejected: 'Rechazado',
      rescheduled: 'Reprogramado',
      pending: 'Pendiente',
    };
    return traducciones[status] || status;
  };

  // Lógica de filtrado para los gráficos
  const datosFiltradosParaGraficos = useMemo(() => {
    if (filtros.profesorId === 'todos') return solicitudes;
    return solicitudes.filter(s => s.professorId === parseInt(filtros.profesorId));
  }, [solicitudes, filtros.profesorId]);

  // Cálculos para los gráficos
  const { stats, materiasChartData, tipoChartData, mensualChartData } = useMemo(() => {
    const datos = datosFiltradosParaGraficos;
    const stats = {
      asesoriasCompletadas: datos.filter(s => s.status === 'completed').length,
      estudiantesAtendidos: [...new Set(datos.map(a => a.studentId || a.studentName))].length,
      materiasUnicas: [...new Set(datos.map(a => a.subject))].length,
    };
    const datosMaterias = datos.reduce((acc, a) => { acc[a.subject] = (acc[a.subject] || 0) + 1; return acc; }, {});
    const datosTipo = datos.reduce((acc, a) => { const tipo = a.type ? (a.type.charAt(0).toUpperCase() + a.type.slice(1)) : 'Individual'; acc[tipo] = (acc[tipo] || 0) + 1; return acc; }, {});
    const datosMensual = datos.reduce((acc, a) => { const mes = new Date(a.date).toLocaleString('es-ES', { month: 'long', year: 'numeric' }); acc[mes] = (acc[mes] || 0) + 1; return acc; }, {});
    const chartColors = ['rgba(102, 126, 234, 0.8)', 'rgba(78, 205, 196, 0.8)', 'rgba(255, 107, 107, 0.8)', 'rgba(153, 102, 255, 0.8)'];
    return {
      stats,
      materiasChartData: { labels: Object.keys(datosMaterias), datasets: [{ data: Object.values(datosMaterias), backgroundColor: chartColors }] },
      tipoChartData: { labels: Object.keys(datosTipo), datasets: [{ data: Object.values(datosTipo), backgroundColor: chartColors }] },
      mensualChartData: { labels: Object.keys(datosMensual), datasets: [{ label: 'Asesorías', data: Object.values(datosMensual), backgroundColor: 'rgba(102, 126, 234, 0.7)' }] },
    };
  }, [datosFiltradosParaGraficos]);

  // Función para convertir imagen a base64 (para el logo)
  const getLogoBase64 = () => {
    // Aquí debes incluir tu logo en formato base64
    // Puedes convertir tu imagen usando herramientas online o código
    return "data:image/webp;base64,"; // Placeholder - reemplazar con logo real
  };

  const handleGeneratePDF = () => {
    setLoading(true);

    // Filtrar datos
    let datosParaPdf = (filtros.profesorId === 'todos')
      ? solicitudes
      : solicitudes.filter(s => s.professorId === parseInt(filtros.profesorId));

    datosParaPdf = datosParaPdf.filter(s => s.status === 'completed');

    if (filtros.fechaInicio) {
      const inicio = new Date(filtros.fechaInicio + 'T00:00:00');
      datosParaPdf = datosParaPdf.filter(s => new Date(s.date) >= inicio);
    }
    if (filtros.fechaFin) {
      const fin = new Date(filtros.fechaFin + 'T23:59:59');
      datosParaPdf = datosParaPdf.filter(s => new Date(s.date) <= fin);
    }

    const profesorSeleccionado = filtros.profesorId !== 'todos' ? profesores.find(p => p.id === parseInt(filtros.profesorId)) : null;
    const doc = new jsPDF();

    // ==================================================================
    // ENCABEZADO FORMAL CON LOGO Y DISEÑO PROFESIONAL
    // ==================================================================
    
    // Colores institucionales
    const colorPrimario = [0, 51, 102]; // Azul institucional
    const colorSecundario = [128, 128, 128]; // Gris

    // Fondo del encabezado
    doc.setFillColor(...colorPrimario);
    doc.rect(0, 0, 210, 45, 'F');

    // Logo (lado izquierdo)
    try {
      const logoBase64 = getLogoBase64();
      doc.addImage(logoBase64, 'PNG', 10, 5, 35, 35);
    } catch (error) {
      // Si no se puede cargar el logo, mostrar un placeholder
      doc.setFillColor(255, 255, 255);
      doc.circle(27.5, 22.5, 17.5, 'F');
      doc.setTextColor(0, 51, 102);
      doc.setFontSize(12);
      doc.text('LOGO', 22, 25);
    }

    // Información institucional (lado derecho)
    doc.setTextColor(255, 255, 255);
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(16);
    doc.text('UNIVERSIDAD POLITÉCNICA', 55, 15);
    doc.text('DE CHIAPAS', 55, 25);
    
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    doc.text('"Tecnología para el bien común"', 55, 35);

    // Línea separadora
    doc.setDrawColor(...colorSecundario);
    doc.setLineWidth(0.5);
    doc.line(10, 50, 200, 50);

    // ==================================================================
    // INFORMACIÓN DEL REPORTE
    // ==================================================================
    doc.setTextColor(0, 0, 0);
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(18);
    doc.text('REPORTE DE ASESORÍAS ACADÉMICAS', 105, 65, { align: 'center' });

    doc.setFont('helvetica', 'normal');
    doc.setFontSize(14);
    doc.text('Asesorías Completadas', 105, 75, { align: 'center' });

    // Información del reporte en tabla formal
    const infoY = 90;
    
    // Fondo gris claro para la información
    doc.setFillColor(248, 249, 250);
    doc.rect(10, infoY - 5, 190, 30, 'F');
    
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(11);
    doc.setTextColor(...colorPrimario);
    
    // Columna izquierda
    doc.text('Periodo:', 15, infoY + 5);
    doc.text('Profesor:', 15, infoY + 12);
    
    // Columna derecha - valores
    doc.setFont('helvetica', 'normal');
    doc.setTextColor(0, 0, 0);
    
    const periodo = filtros.periodo || '_________________________';
    doc.text(periodo, 45, infoY + 5);
    
    const nombreProfesor = profesorSeleccionado?.name || 'Todos los Profesores';
    doc.text(nombreProfesor, 45, infoY + 12);

    // Rango de fechas si aplica
    if (filtros.fechaInicio || filtros.fechaFin) {
      doc.setFont('helvetica', 'bold');
      doc.setTextColor(...colorPrimario);
      doc.text('Rango de fechas:', 110, infoY + 5);
      
      doc.setFont('helvetica', 'normal');
      doc.setTextColor(0, 0, 0);
      const fInicio = filtros.fechaInicio ? new Date(filtros.fechaInicio+'T00:00:00').toLocaleDateString('es-ES') : '...';
      const fFin = filtros.fechaFin ? new Date(filtros.fechaFin+'T00:00:00').toLocaleDateString('es-ES') : '...';
      doc.text(`Del ${fInicio}`, 110, infoY + 12);
      doc.text(`Al ${fFin}`, 110, infoY + 19);
    }

    // Resumen estadístico
    const totalAsesorias = datosParaPdf.length;
    const estudiantesUnicos = [...new Set(datosParaPdf.map(a => a.studentId || a.studentName))].length;
    const materiasUnicas = [...new Set(datosParaPdf.map(a => a.subject))].length;

    doc.setFont('helvetica', 'bold');
    doc.setFontSize(12);
    doc.setTextColor(...colorPrimario);
    doc.text('RESUMEN EJECUTIVO', 15, infoY + 30);

    doc.setFont('helvetica', 'normal');
    doc.setFontSize(10);
    doc.setTextColor(0, 0, 0);
    doc.text(`Total de asesorías completadas: ${totalAsesorias}`, 15, infoY + 37);
    doc.text(`Estudiantes atendidos: ${estudiantesUnicos}`, 15, infoY + 43);
    doc.text(`Materias impartidas: ${materiasUnicas}`, 15, infoY + 49);

    // ==================================================================
    // TABLA DE DATOS
    // ==================================================================
    const tableColumn = ["Fecha", "Profesor", "Estudiante", "Matrícula", "Materia", "Tipo", "Observaciones"];
    const tableRows = datosParaPdf.map(item => [
      new Date(item.date).toLocaleDateString('es-ES', { timeZone: 'UTC' }),
      item.professor?.user?.name || 'N/A',
      item.student?.user?.name || item.studentName || 'N/A',
      item.student?.studentCode || item.student?.matricula || item.studentMatricula || 'N/A',
      item.subject,
      item.type ? (item.type.charAt(0).toUpperCase() + item.type.slice(1)) : 'Individual',
      item.observations || item.observaciones || item.description || item.rejectionReason || '-'
    ]);

    autoTable(doc, {
      head: [tableColumn],
      body: tableRows,
      startY: infoY + 60,
      theme: 'striped',
      headStyles: { 
        fillColor: colorPrimario,
        textColor: [255, 255, 255],
        fontSize: 9,
        fontStyle: 'bold',
        halign: 'center'
      },
      styles: { 
        fontSize: 8,
        cellPadding: 3,
        overflow: 'linebreak'
      },
      columnStyles: {
        0: { halign: 'center', cellWidth: 22 }, // Fecha
        1: { cellWidth: 30 }, // Profesor
        2: { cellWidth: 25 }, // Estudiante
        3: { halign: 'center', cellWidth: 20 }, // Matrícula
        4: { cellWidth: 25 }, // Materia
        5: { halign: 'center', cellWidth: 20 }, // Tipo
        6: { cellWidth: 40 } // Observaciones
      },
      alternateRowStyles: {
        fillColor: [248, 249, 250]
      },
      didDrawPage: (data) => {
        // Header en páginas adicionales
        if (data.pageNumber > 1) {
          doc.setFillColor(...colorPrimario);
          doc.rect(0, 0, 210, 25, 'F');
          doc.setTextColor(255, 255, 255);
          doc.setFont('helvetica', 'bold');
          doc.setFontSize(12);
          doc.text('UNIVERSIDAD POLITÉCNICA DE CHIAPAS', 105, 15, { align: 'center' });
        }

        // Footer profesional
        const pageHeight = doc.internal.pageSize.height;
        const pageNumber = data.pageNumber;
        const totalPages = doc.internal.getNumberOfPages();
        
        // Línea del footer
        doc.setDrawColor(...colorSecundario);
        doc.setLineWidth(0.3);
        doc.line(10, pageHeight - 25, 200, pageHeight - 25);
        
        // Información del footer
        doc.setTextColor(...colorSecundario);
        doc.setFont('helvetica', 'normal');
        doc.setFontSize(8);
        doc.text('Universidad Politécnica de Chiapas - Sistema de Asesorías Académicas', 15, pageHeight - 20);
        doc.text(`Página ${pageNumber} de ${totalPages}`, 200, pageHeight - 20, { align: 'right' });
      }
    });

    // ==================================================================
    // FIRMA FORMAL AL FINAL
    // ==================================================================
    const finalY = doc.lastAutoTable.finalY || 200;
    const pageHeight = doc.internal.pageSize.height;
    const pageWidth = doc.internal.pageSize.width;
    
    // Verificar si hay espacio suficiente para la firma (necesitamos al menos 40px)
    const espacioNecesario = 40;
    const espacioDisponible = pageHeight - finalY - 30; // 30px para el footer
    
    let signatureY;
    if (espacioDisponible < espacioNecesario) {
      // No hay espacio, agregar nueva página
      doc.addPage();
      signatureY = 50; // Empezar más arriba en la nueva página
    } else {
      // Hay espacio, usar la misma página
      signatureY = finalY + 20;
    }
    
    // Marco para la firma
    doc.setDrawColor(...colorSecundario);
    doc.setLineWidth(0.5);
    const firmaWidth = 80;
    const firmaX = (pageWidth - firmaWidth) / 2;
    
    // Línea para la firma
    doc.line(firmaX, signatureY, firmaX + firmaWidth, signatureY);
    
    // Texto de la firma
    doc.setTextColor(0, 0, 0);
    doc.setFont('helvetica', 'bold');
    doc.setFontSize(11);
    doc.text('DIRECTOR ACADÉMICO', pageWidth / 2, signatureY + 8, { align: 'center' });
    
    doc.setFont('helvetica', 'normal');
    doc.setFontSize(9);
    doc.text('Universidad Politécnica de Chiapas', pageWidth / 2, signatureY + 15, { align: 'center' });

    const nombreArchivo = profesorSeleccionado 
      ? `Reporte_Asesorias_${nombreProfesor.replace(/\s/g, '_')}_${new Date().toISOString().split('T')[0]}.pdf`
      : `Reporte_General_Asesorias_${new Date().toISOString().split('T')[0]}.pdf`;
    
    doc.save(nombreArchivo);
    setLoading(false);
  };

  const handleFiltroChange = (campo, valor) => {
    setFiltros(prev => ({ ...prev, [campo]: valor }));
  };

  const chartOptions = { responsive: true, maintainAspectRatio: false };

  return (
    <div className="space-y-6">
      <Card>
        <h3 className="text-lg font-semibold text-gray-900 mb-4">Filtros de Reporte</h3>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6 items-end">
          <FormGroup label="Ver datos de:" icon="Users">
            <select
              value={filtros.profesorId}
              onChange={(e) => handleFiltroChange('profesorId', e.target.value)}
              className="w-full px-3 py-2 border border-gray-300 rounded-lg focus:ring-2 focus:ring-blue-500"
            >
              <option value="todos">Todos los Profesores (General)</option>
              {profesores.map(prof => (
                <option key={prof.id} value={prof.id}>
                  {prof.name || `Profesor ID: ${prof.id}`}
                </option>
              ))}
            </select>
          </FormGroup>
          <FormGroup label="Fecha de Inicio" icon="Calendar">
            <input 
              type="date" 
              className="w-full px-3 py-2 border border-gray-300 rounded-lg"
              value={filtros.fechaInicio} 
              onChange={(e) => handleFiltroChange('fechaInicio', e.target.value)} 
            />
          </FormGroup>
          <FormGroup label="Fecha de Fin" icon="Calendar">
            <input 
              type="date" 
              className="w-full px-3 py-2 border border-gray-300 rounded-lg"
              value={filtros.fechaFin} 
              onChange={(e) => handleFiltroChange("fechaFin", e.target.value)} 
            />
          </FormGroup>
          <FormGroup label="Periodo" icon="Calendar">
            <input 
              type="text" 
              className="w-full px-3 py-2 border border-gray-300 rounded-lg"
              value={filtros.periodo} 
              onChange={(e) => handleFiltroChange("periodo", e.target.value)} 
              placeholder="Ej: Enero - Junio 2025" 
            />
          </FormGroup>
        </div>
        <div className="mt-6 flex flex-col sm:flex-row gap-3">
          <CustomButton 
            onClick={handleGeneratePDF} 
            variant="primary" 
            icon="Download" 
            disabled={loading} 
            className="flex-1 sm:flex-none"
          >
            {loading ? 'Generando Reporte...' : 'Generar Reporte Oficial PDF'}
          </CustomButton>
          <div className="text-sm text-gray-600 flex items-center">
            <Icon name="Info" className="w-4 h-4 mr-1" />
            Solo incluye asesorías completadas
          </div>
        </div>
      </Card>

      {/* Los gráficos y estadísticas */}
      <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
        <StatCard icon="CheckSquare" label="Asesorías Completadas" value={stats.asesoriasCompletadas} color="blue" />
        <StatCard icon="Users" label="Estudiantes Atendidos" value={stats.estudiantesAtendidos} color="green" />
        <StatCard icon="BookOpen" label="Materias Diferentes" value={stats.materiasUnicas} color="purple" />
      </div>

      <div className="grid grid-cols-1 lg:grid-cols-2 gap-8">
        <Card>
          <h3 className="text-lg font-semibold text-blue-600 mb-4">Distribución por Materia</h3>
          <div className="h-80">
            {datosFiltradosParaGraficos.length > 0 ? (
              <Pie data={materiasChartData} options={chartOptions} />
            ) : (
              <NoDataMessage />
            )}
          </div>
        </Card>
        <Card>
          <h3 className="text-lg font-semibold text-blue-600 mb-4">Asesorías por Mes</h3>
          <div className="h-80">
            {datosFiltradosParaGraficos.length > 0 ? (
              <Bar data={mensualChartData} options={chartOptions} />
            ) : (
              <NoDataMessage />
            )}
          </div>
        </Card>
        <Card>
          <h3 className="text-lg font-semibold text-blue-600 mb-4">Distribución por Tipo</h3>
          <div className="h-80">
            {datosFiltradosParaGraficos.length > 0 ? (
              <Pie data={tipoChartData} options={chartOptions} />
            ) : (
              <NoDataMessage />
            )}
          </div>
        </Card>
      </div>
    </div>
  );
};

const StatCard = ({ icon, label, value, color }) => {
  const colors = { 
    blue: 'text-blue-600 bg-blue-100', 
    green: 'text-green-600 bg-green-100', 
    purple: 'text-purple-600 bg-purple-100' 
  };
  return (
    <div className={`p-4 rounded-lg shadow ${colors[color].split(' ')[1]}`}>
      <div className="flex items-center">
        <Icon name={icon} className={`w-8 h-8 mr-4 ${colors[color].split(' ')[0]}`} />
        <div>
          <p className="text-2xl font-bold text-gray-900">{value}</p>
          <p className="text-sm font-medium text-gray-600">{label}</p>
        </div>
      </div>
    </div>
  );
};

const NoDataMessage = () => (
  <div className="flex items-center justify-center h-full text-gray-500">
    <div className="text-center">
      <Icon name="BarChart3" size={48} className="mx-auto mb-4 opacity-50" />
      <p>No hay datos para mostrar con los filtros seleccionados.</p>
    </div>
  </div>
);

export default ReportesDirector;